import React from 'react';
import './PageTransition.css';

function PageTransition({ isActive, children }) {
  return (
    <>
      <div className={`page-transition ${isActive ? 'active' : ''}`}></div>
      <div className="page-content">
        {children}
      </div>
    </>
  );
}

export default PageTransition;
